using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;
using System.Numerics;

namespace NethereumAccess.Definitions
{
    public partial class TraderDeployment : TraderDeploymentBase
    {
        public TraderDeployment() : base(BYTECODE) { }
        public TraderDeployment(string byteCode) : base(byteCode) { }
    }

    public class TraderDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public TraderDeploymentBase() : base(BYTECODE) { }
        public TraderDeploymentBase(string byteCode) : base(byteCode) { }

    }

    public partial class AddListingFunction : AddListingFunctionBase { }

    [Function("addListing")]
    public class AddListingFunctionBase : FunctionMessage
    {
        [Parameter("address", "systemWallet", 1)]
        public virtual string SystemWallet { get; set; }
        [Parameter("uint256", "price", 2)]
        public virtual BigInteger Price { get; set; }
        [Parameter("address", "contractAddress", 3)]
        public virtual string ContractAddress { get; set; }
        [Parameter("uint256", "tokenId", 4)]
        public virtual BigInteger TokenId { get; set; }
    }

    public partial class BalancesFunction : BalancesFunctionBase { }

    [Function("balances", "uint256")]
    public class BalancesFunctionBase : FunctionMessage
    {
        [Parameter("address", "", 1)]
        public virtual string ReturnValue1 { get; set; }
    }

    public partial class ListingsFunction : ListingsFunctionBase { }

    [Function("listings", typeof(ListingsOutputDTO))]
    public class ListingsFunctionBase : FunctionMessage
    {
        [Parameter("address", "", 1)]
        public virtual string ReturnValue1 { get; set; }
        [Parameter("uint256", "", 2)]
        public virtual BigInteger ReturnValue2 { get; set; }
    }

    public partial class PurchaseFunction : PurchaseFunctionBase { }

    [Function("purchase")]
    public class PurchaseFunctionBase : FunctionMessage
    {
        [Parameter("address", "contractAddress", 1)]
        public virtual string ContractAddress { get; set; }
        [Parameter("uint256", "tokenId", 2)]
        public virtual BigInteger TokenId { get; set; }
    }

    public partial class WithdrawFunction : WithdrawFunctionBase { }

    [Function("withdraw")]
    public class WithdrawFunctionBase : FunctionMessage
    {
        [Parameter("uint256", "amount", 1)]
        public virtual BigInteger Amount { get; set; }
        [Parameter("address", "destAddr", 2)]
        public virtual string DestAddr { get; set; }
    }



    public partial class BalancesOutputDTO : BalancesOutputDTOBase { }

    [FunctionOutput]
    public class BalancesOutputDTOBase : IFunctionOutputDTO
    {
        [Parameter("uint256", "", 1)]
        public virtual BigInteger ReturnValue1 { get; set; }
    }

    public partial class ListingsOutputDTO : ListingsOutputDTOBase { }

    [FunctionOutput]
    public class ListingsOutputDTOBase : IFunctionOutputDTO
    {
        [Parameter("uint256", "price", 1)]
        public virtual BigInteger Price { get; set; }
        [Parameter("address", "seller", 2)]
        public virtual string Seller { get; set; }
    }
}
